import { lazy } from "react";

const Main = lazy(() => import("../pages/main"));
const Detail = lazy(() => import("../pages/detail"));

const routes = [
  {
    path: "/",
    component: Main,
  },
  {
    path: "/detail",
    component: Detail,
  },
];

export default routes;
